import React from "react";
import Chip from "@mui/material/Chip";
import Stack from "@mui/material/Stack";

const Shifter = (props) => {
  const timeEmloyee = `${props.time} ${props.employee}`;

  const DeleteShifterHandler = () => {
    return;
  };
  return (
    <Chip
      label={timeEmloyee}
      onDelete={DeleteShifterHandler}
      style={{ background: "#018301", borderRadius: "2px" }}
    />
  );
};

export default Shifter;
